func lengthOfLongestSubstring1(s string) int {
	var csc []byte
	var ml int
	for i := 0; i < len(s); i++ {
		j := 0
		for j < len(csc) {
			if s[i] == csc[j] {
				break
			}
			j++
		}
		if j < len(csc) {
			cl := len(csc)
			if cl > ml {
				ml = cl
			}
			csc = csc[j+1:]

		}
		csc = append(csc, s[i])
	}
	if len(csc) > ml {
		ml = len(csc)
	}
	return ml
}

func lengthOfLongestSubstring2(s string) int {
	arrString := [1000]int{}
	indexOfArr := 0
	maxLen := 0
	// ÂàùÂßãÂåñ‰∏∫ -1
	for i, _ := range arrString {
		arrString[i] = -1
	}
	for i, char := range s {
		if arrString[char] != -1 {
			indexOfArr++
			arrString = resetArrAtring(i, char, arrString)
			arrString[char] = i
		} else {
			arrString[char] = i
		}
		tempLen := lenOfArrString(arrString)
		if tempLen > maxLen {
			maxLen = tempLen
		}
	}
	return maxLen
}

// Â∞ÜÂ∞è‰∫éÁ≠â‰∫éiÁöÑÂÄºÊ∏ÖÁ©∫
func resetArrAtring(i int, char int32, strings [1000]int) [1000]int {
	temp := strings[char]
	for index, j := range strings {
		if j <= temp && j != -1 {
			strings[index] = -1
		}
	}
	return strings
}

func lenOfArrString(strings [1000]int) int {
	sum := 0
	for i := 0; i < len(strings); i++ {
		if strings[i] != -1 {
			sum++
		}
	}
	return sum
}
